class Principal extends Component {
    render() {
        return (
            <div className="contenedorww">
                <div className="row">
                    <div className="col-4">
                    <BuscarCliente />
                    </div>
                    <div className="col-8">
                    <BuscarProducto />
                    </div>
                    
                </div>
                <br />
                 
                <br />
                <div className="row">
                    
                </div>
            </div>
        );
    }
}

export default Principal;
